      | 3650 -> { ItemTypeData.id= 3650; name= "Amarr Apocalypse Battleship"; published= false; description= "In days past, only those in high favor with the Emperor could hope to earn the reward of commanding one of the majestic and powerful Apocalypse class battleships. In latter years, even though now in full market circulation, these golden, metallic monstrosities are still feared and respected as enduring symbols of Amarrian might."; marketGroupId= None; groupId= 226; dogmaAttributes= [| { DogmaAttributeValueData.attributeId = 9; value= 100000000.000000 }; { DogmaAttributeValueData.attributeId = 162; value= 400.000000 }; { DogmaAttributeValueData.attributeId = 4; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 38; value= 0.000000 }; { DogmaAttributeValueData.attributeId = 161; value= 0.000000 } |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= Some(296); mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 400.000000; volume= 0.000000 } |> Some
      | 365460 -> { ItemTypeData.id= 365460; name= "'Crawtide' Ishukone Assault Rail Rifle"; published= false; description= "Part of Kaalakiota’s Stahl line of weaponry, the rail rifle is a fast-firing precision weapon designed for field operations where penetrative power and range are paramount. Developed using the corporation’s proprietary microscale technology, the rail rifle solves oversaturation issues endemic to sustained fire electromagnetic weaponry.  However, its greater range and power are offset by a smaller magazine capacity and lower rate of fire than similarly classified weapons.    The foregrip design aids stabilization and remains cool to the touch even during prolonged discharge where the barrel can exceed mean operating temperatures. Featuring a reinforced subassembly and compact, heavy-barrel design, the rail rifle is the premier fully automatic microscale weapon available today."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
