      | 366236 -> { ItemTypeData.id= 366236; name= "Faction Booster Caldari (7-Day)"; published= false; description= "Faction boosters are biometric identification chips issued by major factions throughout New Eden. Once activated they uniquely identify the user as a supporter of the issuing faction. Corporations operating on behalf of the faction will then be authorized to increase rewards to that individual."; marketGroupId= None; groupId= 354641; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.000000; portionSize= 1; radius= 1.000000; volume= 0.000000 } |> Some
      | 366430 -> { ItemTypeData.id= 366430; name= "Imperial ELM-7 Laser Rifle"; published= false; description= "The laser rifle is a continuous wave, medium range weapon. Targets are ‘painted’ with a high intensity beam that deals sustained, focused damage in a concentrated area to maximize damage potential.  At the core of the weapon is the thermal cavity, within which an optic spacer converges and blends three individually pumped beams into a single coherent output. The additional distortion introduced by each beam results in weakened output at close range, but as the weapon warms up to mean operating temperature the wavelength stabilizes and the damage output increases significantly, producing a weapon of unmatched precision and lethality in mid-range combat.  Heat build-up is typically managed by a self-regulating failsafe, a device used to forcibly shut the weapon off at regular intervals, flushing heat from its internal workings and preventing lethal feedback to the user, but most laser rifles in the field have been altered to bypass the built-in safety protocols."; marketGroupId= None; groupId= 350858; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
