      | 4329 -> { ItemTypeData.id= 4329; name= "Research Abstract: Project Astrosurvey"; published= true; description= "<b>Paper:</b> Astrosurvey<br>  <b>Lead Researcher:</b> Pr. Gehen Sealbreaker<br>  <b>Contributors:</b> Sealbreaker Labs, Vincent Athena<br>  <b>Summary:</b> The homogeneity of the asteroids located in Anoikis is improbable, and ores extracted there have been thrown in refineries using old refining processes with no proper study. Considering current survey scanners only compare asteroid properties to a known ores database, their current classification may be wrong and not reflect their full potential.    Three possibilities other than an improbable homogeneity can explain this:<br>     1. Ores in Anoikis are plain. Specific conditions in New Eden contributed to variants' formation.<br>     2. Specific ores existed in Anoikis. Their supply was depleted by intensive exploitation from previous occupants.<br>     3. There are specific ore variants in Anoikis. Tolerance of survey scanners made us unaware of this. (Hypothesis studied)    When it comes to crystal formation, stellar macroscopic effects are a main factor. Cosmic phenomenon must be considered, and samples from their systems studied.    The operation had 3 steps so far:<br>     1. Establishment of a scientific base camp in Anoikis.<br>     2. Harvesting and initial study of resources.<br>     3. Study of the collected samples using laboratories in Empire stations. (Ongoing)<br>    Current results are inconclusive, but there is still much to do. So far, no collected ore matches the molecular structure of any known ore variant, common or rare (Luminous Kernite, Banidine, Polygypsum, etc).    <i>This abstract relates to research undertaken by the Arek'Jaalan Project.</i>    <i>Authorized for capsuleer dissemination under the CONCORD Freedom of Distribution Act (Alpha-One-Five), YC 113.11.4</i>    <i>Further copies of this document can be obtained through the Arek'Jaalan administrative site, located in the <a href=showinfo:5//30003413>Eram</a> system.<i>"; marketGroupId= None; groupId= 1141; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 1.000000; packagedVolume= 0.100000; portionSize= 1; radius= 1.000000; volume= 0.100000 } |> Some
