      | 53023 -> { ItemTypeData.id= 53023; name= "Ikitursa All-Stars Casino Clash SKIN"; published= true; description= "The Grand Teigjon Resort & Casino in Vellaine has been the prime venue for Interstellar Mind Clash Championships for many years and will host the 99th Worlds Championships in October YC121. The event is being heavily promoted by the Grand Teigjon as an  All-Stars Casino Clash  with the likes of Zirud  Black Dragon  Mikkela, Parvir  Flame Dancer  an-Zoar, Nadia  Silver Bear  Tanaka, and Joelyn  Blue Tiger  Donalokos vying for the coveted Worlds Champion title.    The Echelon Entertainment Station in Vellaine has long been a magnet for Mind Clash fans due to the presence of the prestigious Grand Teigjon Resort at the heart of the station's large leisure district. Even when major championships are not being hosted, there is an active Mind Clash circuit and numerous conventions and exhibition matches are often being held there.    Capsuleers are a significant demographic among the most dedicated Mind Clash fans, finding the complex, mentally-demanding neuro-holographic game endlessly entertaining. Naturally, for Echelon Entertainment, the attendance of large numbers of capsuleers at the Worlds Championships is always welcome due to their huge spending power."; marketGroupId= Some(2485); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
