      | 55351 -> { ItemTypeData.id= 55351; name= "Crusader Biosecurity Responders SKIN"; published= true; description= "CONCORD Biosecurity Responders are available to be dispatched on emergency call to any space stations, orbital infrastructure or other space-industrial locations in response to disease and pathogen outbreaks of all kinds.  The challenges of maintaining biosecurity against infectious pathogens and other disease vectors in space-based infrastructure are multiplied by the cosmopolition and highly-interconnected nature of New Eden's space industry and trade networks. This long-recognised problem was for many decades dealt with by the empires, nations and corporations of New Eden in a rather piecemeal fashion, with disputes over jurisdiction and differing standards commonly arising.  Following the Kyonoke Crisis of YC119, and the passage of the interstellar  Hope for All Act , CONCORD established Biosecurity Response Teams, and began to build up its capacity and expertise in the fields of epidemiology and disease management. To that end, CONCORD reached out to partners such as the University of Caille's Department of Epidemiology, Hedion University's School of Medicine, the Sisters of EVE, and the Society of Conscious Thought.  Biosecurity Responders are a vital link in any effort to isolate and analyze infectious pathogens spreading through New Eden's space infrastructure, and crucially to prevent spread to planetary populations. Research to develop effective biosecurity methods, treatments and pathogen controls rely on the field research and data provided by the Biosecurity Reponse Teams."; marketGroupId= Some(2059); groupId= 1950; dogmaAttributes= [|  |]; dogmaEffects= [|  |]; capacity= 0.000000; graphicId= None; mass= 0.000000; packagedVolume= 0.010000; portionSize= 1; radius= 1.000000; volume= 0.010000 } |> Some
